          const QOTS = document.getElementById("QOTS");
          const speed = 100; // Pixels per second

          const xstart=(QOTS.x.baseVal.value);
          const ystart=(QOTS.y.baseVal.value);


          function animateTo(element, targetX, targetY, speed = 200) {
            let startX = element.x.baseVal.value;
            let startY = element.y.baseVal.value;
            let startTime = performance.now();

            // Calculate the distance to travel
            let deltaX = targetX - startX;
            let deltaY = targetY - startY;
            let distance = Math.sqrt(deltaX ** 2 + deltaY ** 2); // Pythagorean theorem

            // Calculate duration based on speed (distance / speed)
            let duration = distance / speed * 1000; // Convert seconds to milliseconds

            function step(currentTime) {
              let elapsed = currentTime - startTime;
              let progress = Math.min(elapsed / duration, 1); // Normalize between 0 and 1

              // Interpolate X and Y positions
              element.x.baseVal.value = startX + deltaX * progress;
              element.y.baseVal.value = startY + deltaY * progress;

              if (progress < 1) {
                requestAnimationFrame(step);
              }
            }

            requestAnimationFrame(step);
          }
