        <text xml:space="preserve" x="88.849106" y="102.08733">
          <tspan x="88.849106" y="102.08733" style="font-weight:bold">Move the Queen 3 times only.</tspan>
          <tspan x="88.849106" y="106.14983" >Avoid Danger; follow guides;</tspan>
          <tspan x="88.849106" y="110.21233" >route via fairway if present.</tspan>
          <tspan x="88.849106" y="118.33733" >Each way point, gives a code digit.</tspan>
          <tspan x="88.849106" y="122.39983" >(taking the unit of the value of rank * file.)</tspan>
          <tspan x="20" y="131" style="font-size:4.75px;font-weight:bold">Move the Queen into port (rank 1 i.e. the bottom row)</tspan>
